import React,{Component} from 'react';

class UserInput extends Component{
    changeDate =() =>{
        this.props.updateDate2("2030-01-01")
    }
  render(){
    return(
      <div className="d-flex justify-content-center">
        <div className="col-lg-6 border p-2 d-flex  justify-content-center">
          <input className="form-control w-50"/>
          <button onClick={this.changeDate} className="btn btn-secondary">change date</button>
        </div>
      </div> 
    )
}
}

export default UserInput
